import React from 'react';
import Router from 'next/router';
import User from '../../components/User';

const authIndexPage = () => {
  return (
    <div>
      <h1>The auth main Page</h1>
      <button onClick={() => Router.push('/')}>Go to Home</button>
    </div>
  );
};

export default authIndexPage;
